abel:{label:"हमारे बारे में"},grievanceSystemTitle:{label:"शिकायत प्रबंधन और निवारण प्रणाली"},grievanceSystemText:{label:"झारखंड सरकार ने अच्छी शासन प्रणाली के उद्देश्यों को प्राप्त करने के लिए सूचना प्रौद्योगिकी का उपयोग करके एक जन शिकायत प्रबंधन प्रणाली का अमल किया है। इस प्रणाली को एक समूहित शिकायत समाधान प्रणाली कहा जाता है, जिससे नागरिकों और सरकार / विभाग / सार्वजनिक कार्यालयों के बीच आसान और पारदर्शी संचार स्थापित करने में मदद मिलती है। नागरिक अपनी शिकायतों को किसी भी समय ऑनलाइन पंजीकृत / प्राप्त कर सकते हैं। विभिन्न स्रोतों से प्राप्त शिकायतें एक ही पोर्टल / प्लेटफ़ॉर्म पर उपलब्ध हो सकती हैं, जिससे विभागीय अधिकारियों को शिकायतों के समाधान और मॉनिटरिंग के लिए सुविधा प्राप्त होती है।"},registerGrievanceLabel:{label:"शिकायत पंजीकरण"},closeModalLabel:{label:"मॉडल बंद करें"},notConsideredPointsLabel:{label:"ऐसे पायंट्स जिन्हें सार्वजनिक शिकायत के रूप में नहीं माना जाएगा"},rtiMattersLabel:{label:"1. आरटीआई से संबंधित मामले"},judiciaryMattersLabel:{label:"2. न्यायिक मामले"},centralGovernmentMattersLabel:{label:"3. केंद्र सरकार द्वारा अंगीकृत मामले"},sanitaryServicesLabel:{label:"4. स्वच्छता सेवाएँ इस पोर्टल द्वारा समर्थित नहीं हैं"},schemesPoliciesLabel:{label:"5. योजनाओं और नीतियों से संबंधित मामले"},suggestionsLabel:{label:"6. सुझाव"},employmentHelpLabel:{label:"7. रोजगार या वित्तीय सहायता की मांग करने वाली शिकायतें"},religiousMattersLabel:{label:"8. धार्मिक मामले"},acknowledgeTermsLabel:{label:"मैं स्वीकार करता हूँ कि मैंने ऊपर दिए गए नियम और शर्तों को पढ़कर स्वीकार किया है"},startLabel:{label:"शुरू करें"},cancelLabel:{label:"रद्द करें"},step1Label:{label:"चरण 1"},phoneOtpLabel:{label:"फ़ोन और OTP"},step2Label:{label:"चरण 2"},grievanceFormLabel:{label:"शिकायत फ़ॉर्म"},step3Label:{label:"चरण 3"},acknowledgementLabel:{label:"पुष्टि"},completedLabel:{label:"पूरा हुआ"},inProcessLabel:{label:"प्रक्रिया में"},pendingLabel:{label:"लंबित"},enter10DigitMobileNoLabel:{label:"10 अंकों का मोबाइल नंबर दर्ज करें"},verifyPhoneNumberLabel:{label:"फ़ोन नंबर सत्यापित करें"},enterM